  `phones` varchar(100) NOT NULL COMMENT '发送对象',
  `create_date` datetime NOT NULL COMMENT '创建日期',
  `remark` varchar(100) DEFAULT NULL COMMENT '备注',
  `del_flag` char(1) DEFAULT '0' COMMENT '是否删除 0否 1是',
  `f1` varchar(64) DEFAULT NULL COMMENT 'f1',
  `type` varchar(2) DEFAULT '0' COMMENT '站内信类型 0系统发送 1手动发送',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='站内信管理';

