  `num` varchar(30) NOT NULL COMMENT '统计结果',
  `type` varchar(2) NOT NULL COMMENT '类型1截止上月交易笔数2截止上月累计充值金额3截止上月历史交易返现4邀请用户上月充值金额5邀请用户上月交易返现',
  `isBoss` varchar(2) NOT NULL COMMENT '0员工统计1公司统计',
  `create_date` datetime NOT NULL COMMENT '统计时间',
  `remarks` varchar(64) DEFAULT NULL COMMENT '备注',
  `employee_id` varchar(64) DEFAULT NULL COMMENT '员工id',
