-- ----------------------------
-- Table structure for `hyk_oil_card`
-- ----------------------------
DROP TABLE IF EXISTS `hyk_oil_card`;
CREATE TABLE `hyk_oil_card` (
  `id` varchar(64) NOT NULL COMMENT '编号',
  `user_id` varchar(64) NOT NULL COMMENT '用户编号',
  `oli_card_no` varchar(64) NOT NULL COMMENT '加油卡号',
  `name` varchar(64) DEFAULT NULL COMMENT '充值人姓名',
  `phone` varchar(64) DEFAULT NULL COMMENT '手机号码',
  `oil_type` varchar(64) DEFAULT NULL COMMENT '油卡类型 1中石油2 中石化',
  `money` decimal(10,2) DEFAULT '0.00' COMMENT '累计充值金额',
  `wait_money` decimal(10,2) DEFAULT '0.00' COMMENT '剩余待充金额',
  `create_by` varchar(64) DEFAULT NULL COMMENT '创建人',
  `create_date` datetime DEFAULT NULL COMMENT '创建时间',
  `update_by` varchar(64) DEFAULT NULL COMMENT '修改人',
  `update_date` datetime DEFAULT NULL COMMENT '修改时间',
  `remark` varchar(100) DEFAULT NULL COMMENT '备注',
  `del_flag` char(1) DEFAULT '0' COMMENT '是否删除',
  `ydz_money` decimal(10,2) DEFAULT '0.00' COMMENT '本月应到账金额',
  `sjdz_money` decimal(10,2) DEFAULT '0.00' COMMENT '本月已到账金额',
  `label` varchar(64) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='加油卡管理';

