  `user_id` varchar(64) NOT NULL COMMENT '用户编号',
  `periods_num` int(11) DEFAULT NULL COMMENT '剩余期数',
  `oil_date` datetime DEFAULT NULL COMMENT '加油时间',
  `plan_oil_date` datetime DEFAULT NULL COMMENT '计划加油时间',
  `money` decimal(10,2) DEFAULT NULL COMMENT '本期计划加油金额',
  `status` varchar(2) DEFAULT NULL COMMENT '状态 0待加油 1已加油',
  `create_by` varchar(64) DEFAULT NULL COMMENT '创建人',
  `create_date` datetime DEFAULT NULL COMMENT '创建时间',
  `update_by` varchar(64) DEFAULT NULL COMMENT '修改人',
  `update_date` datetime DEFAULT NULL COMMENT '修改时间',
  `remark` varchar(100) DEFAULT NULL COMMENT '备注',
  `del_flag` char(1) DEFAULT '0' COMMENT '是否删除',
  `goodId` varchar(64) DEFAULT NULL COMMENT '商品id',
  `orderId` varchar(64) DEFAULT NULL COMMENT '订单id',
  `cardId` varchar(64) DEFAULT NULL COMMENT '油卡id',
