  `city` varchar(8) DEFAULT NULL COMMENT '省份',
  `b90` varchar(8) DEFAULT NULL COMMENT '/*89(90)号*/',
  `b93` varchar(8) DEFAULT NULL COMMENT '/*92(93)号*/',
  `b97` varchar(8) DEFAULT NULL COMMENT '/*95(97)号*/',
  `b0` varchar(8) DEFAULT NULL COMMENT '/*0号*/',
  `h92` varchar(8) DEFAULT NULL COMMENT '/*建议取值*/',
  `h95` varchar(8) DEFAULT NULL COMMENT '/*建议取值*/',
  `h98` varchar(8) DEFAULT NULL COMMENT '/*建议取值*/',
  `h0` varchar(8) DEFAULT NULL COMMENT '/*建议取值*/',
  `create_date` datetime DEFAULT NULL COMMENT '创建日期',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=838 DEFAULT CHARSET=utf8 COMMENT='今日油价';

