CREATE TABLE `hyk_opinion` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '编号',
  `user_id` varchar(64) DEFAULT NULL COMMENT '用户编号',
  `opinion` text COMMENT '意见反馈',
  `times` datetime DEFAULT NULL COMMENT '发布时间',
  `img` varchar(255) DEFAULT NULL COMMENT '图片',
  `status` varchar(16) DEFAULT '0' COMMENT '状态  0新建',
  `remark` varchar(255) DEFAULT NULL COMMENT '备注',
  `f1` varchar(255) DEFAULT NULL,
  `f2` varchar(255) DEFAULT NULL,
  `f3` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='意见反馈 未被使用';

