-- Records of hyk_opinion
-- ----------------------------

-- ----------------------------
-- Table structure for `hyk_order`
-- ----------------------------
DROP TABLE IF EXISTS `hyk_order`;
CREATE TABLE `hyk_order` (
  `id` varchar(64) NOT NULL COMMENT '编号',
  `order_no` varchar(64) DEFAULT NULL COMMENT '订单编号',
  `user_id` varchar(64) DEFAULT NULL COMMENT '用户编号',
  `user_phone` varchar(11) DEFAULT NULL COMMENT '用户手机号',
  `cardId` varchar(64) DEFAULT NULL COMMENT '加油卡id',
  `card_no` varchar(64) DEFAULT NULL COMMENT '充值卡号',
  `order_type` varchar(2) DEFAULT NULL COMMENT '交易类型  0即时充值 1套餐充值',
  `pay_type` varchar(10) DEFAULT NULL COMMENT '付款方式 1微信 2支付宝 3快捷/组合 4银联 6余额',
  `everyAmt` decimal(10,2) DEFAULT NULL COMMENT '每期金额',
  `amt` decimal(10,2) DEFAULT '0.00' COMMENT '订单总金额',
  `goods_id` varchar(64) DEFAULT NULL COMMENT '商品编号  0自定义金额即时充值',
  `redpackage_id` varchar(64) DEFAULT NULL COMMENT '红包编号 ',
  `redpackage_amt` decimal(10,0) DEFAULT '0' COMMENT '红包金额',
  `pay_date` datetime DEFAULT NULL COMMENT '付款时间',
  `order_status` varchar(2) DEFAULT NULL COMMENT '订单状态 0 待充值 1充值中 2已充值 3订单超时 4已失效 5已暂停',
  `oil_status` varchar(2) DEFAULT '0' COMMENT '加油状态 0待加油/加油计划执行中 1已完成',
  `create_by` varchar(64) DEFAULT NULL COMMENT '创建人',
  `create_date` datetime DEFAULT NULL COMMENT '创建时间',
  `update_by` varchar(64) DEFAULT NULL COMMENT '修改人',
  `update_date` datetime DEFAULT NULL COMMENT '修改时间',
  `remark` varchar(100) DEFAULT NULL COMMENT '备注',
  `del_flag` char(1) DEFAULT '0' COMMENT '是否删除',
  `f1` varchar(64) DEFAULT NULL,
  `payable_money` decimal(10,2) DEFAULT NULL COMMENT '应付金额',
  `balance_payment` decimal(10,2) DEFAULT '0.00' COMMENT '余额支付金额',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='订单管理';

