-- Table structure for `hyk_payinfo`
-- ----------------------------
DROP TABLE IF EXISTS `hyk_payinfo`;
CREATE TABLE `hyk_payinfo` (
  `id` varchar(64) NOT NULL,
  `order_no` varchar(64) NOT NULL COMMENT '订单号',
  `req_msg` text COMMENT '请求报文',
  `resp_msg` text COMMENT '反馈报文',
  `code` varchar(64) DEFAULT NULL COMMENT '状态',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='支付报文日志';

-- ----------------------------
-- Records of hyk_payinfo
-- ----------------------------

-- ----------------------------
-- Table structure for `hyk_recharge_card`
-- ----------------------------
DROP TABLE IF EXISTS `hyk_recharge_card`;
CREATE TABLE `hyk_recharge_card` (
  `id` varchar(64) NOT NULL COMMENT '编号',
  `code` int(11) DEFAULT NULL COMMENT '批次号',
  `caredno` varchar(64) DEFAULT NULL COMMENT '卡号',
  `password` varchar(64) DEFAULT NULL COMMENT '卡密',
  `money` int(11) DEFAULT NULL COMMENT '金额',
  `use_method` varchar(2) DEFAULT NULL COMMENT '卡密用途 0印卡卡密 1虚拟商品',
  `sale_status` varchar(2) DEFAULT NULL COMMENT '卡密状态 0未兑换 1已兑换 2已过期 3未发放(虚拟)',
  `remarks` varchar(64) DEFAULT NULL COMMENT '备注',
  `del_flag` varchar(2) DEFAULT '0' COMMENT '是否删除',
  `create_date` datetime DEFAULT NULL COMMENT '生成时间',
  `over_date` datetime DEFAULT NULL COMMENT '过期时间',
  `days` int(11) DEFAULT NULL COMMENT '有效时长天数',
  `status` varchar(2) DEFAULT NULL COMMENT '是否激活 0未激活  1激活',
  PRIMARY KEY (`id`),
  UNIQUE KEY `recharge_id` (`id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='充值卡管理';

-- ----------------------------
-- Records of hyk_recharge_card
-- ----------------------------

-- ----------------------------
-- Table structure for `hyk_redpackage`
-- ----------------------------
DROP TABLE IF EXISTS `hyk_redpackage`;
CREATE TABLE `hyk_redpackage` (
  `id` varchar(64) NOT NULL COMMENT '编号',
  `title` varchar(64) NOT NULL COMMENT '红包名称',
  `money` decimal(10,2) NOT NULL COMMENT '红包金额',
  `user_id` varchar(64) DEFAULT NULL COMMENT '用户id',
  `status` varchar(2) DEFAULT '0' COMMENT '红包状态 0未使用 1已使用 2已过期 3已锁定',
  `send_time` datetime DEFAULT NULL COMMENT '发送时间',
  `use_time` datetime DEFAULT NULL COMMENT '使用时间',
  `over_time` datetime DEFAULT NULL COMMENT '过期时间',
  `create_by` varchar(64) DEFAULT NULL COMMENT '创建人',
  `create_date` datetime DEFAULT NULL COMMENT '创建时间',
  `update_by` varchar(64) DEFAULT NULL COMMENT '修改人',
  `update_date` datetime DEFAULT NULL COMMENT '修改时间',
  `remark` varchar(100) DEFAULT NULL COMMENT '备注',
  `del_flag` char(1) DEFAULT '0' COMMENT '是否删除',
  `f1` varchar(64) DEFAULT NULL,
  `dayNum` int(5) DEFAULT NULL COMMENT '使用天长',
  `redType` varchar(2) DEFAULT NULL COMMENT '限制类型 0套餐充值 1即时充值 2无限制',
  `minAmount` decimal(10,2) DEFAULT NULL COMMENT '订单总金额满多少可用',
  `goodsId` varchar(64) DEFAULT NULL COMMENT '指定商品使用红包',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='红包管理';

-- ----------------------------
-- Records of hyk_redpackage
-- ----------------------------

