-- Table structure for `hyk_token`
-- ----------------------------
DROP TABLE IF EXISTS `hyk_token`;
CREATE TABLE `hyk_token` (
  `id` varchar(64) NOT NULL COMMENT 'id',
  `user_id` varchar(64) DEFAULT NULL COMMENT '用户id',
  `token` varchar(200) DEFAULT NULL COMMENT 'token',
  `create_date` datetime DEFAULT NULL COMMENT '创建时间',
  `ip` varchar(64) DEFAULT NULL COMMENT '用户ip',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='token保存';

-- ----------------------------
-- Records of hyk_token
-- ----------------------------

-- ----------------------------
-- Table structure for `hyk_user`
-- ----------------------------
DROP TABLE IF EXISTS `hyk_user`;
CREATE TABLE `hyk_user` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '编号',
  `phone` varchar(11) NOT NULL COMMENT '注册手机号',
  `password` varchar(100) NOT NULL COMMENT '登录密码',
  `inviter_id` varchar(64) DEFAULT NULL COMMENT '邀请人id',
  `pay_num` int(11) DEFAULT '0' COMMENT '付款交易笔数',
  `oil_card_num` int(11) DEFAULT '0' COMMENT '加油卡数量',
  `channel` varchar(10) DEFAULT NULL COMMENT '渠道',
  `wait_amt` decimal(10,0) DEFAULT NULL COMMENT '待加油金额',
  `send_code_error` int(11) DEFAULT '0' COMMENT '验证码错误次数',
  `account_error` int(11) DEFAULT '0' COMMENT '账户错误次数',
  `openId` varchar(64) DEFAULT NULL COMMENT '微信唯一标识',
  `real_name` varchar(50) DEFAULT NULL COMMENT '真实姓名',
  `headImg` varchar(100) DEFAULT NULL COMMENT '微信头像',
  `sex` varchar(2) DEFAULT '0' COMMENT '性别 1男2女0未知',
  `birthday` datetime DEFAULT NULL COMMENT '生日',
  `register_date` datetime DEFAULT NULL COMMENT '注册时间',
  `remark` varchar(100) DEFAULT NULL COMMENT '备注',
  `del_flag` char(1) DEFAULT '0' COMMENT '是否删除',
  `companyId` varchar(64) DEFAULT NULL COMMENT '所属商户id',
  `companyAddDate` datetime DEFAULT NULL COMMENT '添加员工日期',
  `isBoss` varchar(64) DEFAULT NULL COMMENT '商户类型 0 员工 1商户主',
  `isCompany` varchar(64) DEFAULT '0' COMMENT '用户类型 0普通用户 1商户用户',
  `qrcode` varchar(64) DEFAULT NULL COMMENT '个人邀请二维码',
  `accumulative_recharge_amount` decimal(10,2) DEFAULT '0.00' COMMENT '充值卡充值累计充值金额',
  `account_balance` decimal(10,2) DEFAULT '0.00' COMMENT '账户余额',
  `f1` varchar(255) DEFAULT NULL,
  `f2` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=1144 DEFAULT CHARSET=utf8 COMMENT='用户管理表';

-- ----------------------------
-- Records of hyk_user
