INSERT INTO `hyk_mall_goods` VALUES ('95946fbc01f243c588696a2a7ed38084', '13', '0', '1', '1', '1.00', '1.00', '1', 'http://47.99.115.136:8082/hykweb/f/app/download/image?filePath=/upload/20190123104225.png', '0', '&lt;p&gt;保障项目&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;优选方案B&lt;/p&gt;\n\n&lt;hr /&gt;\n&lt;p&gt;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;司机&nbsp; &nbsp; &nbsp;乘客&lt;/p&gt;\n\n&lt;hr /&gt;\n&lt;p&gt;意外伤害保险/座&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;10万&lt;/p&gt;\n\n&lt;hr /&gt;\n&lt;p&gt;医疗费用/座&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;0.8万&lt;br /&gt;\n其中资费项目限额&nbsp; &nbsp; &nbsp;不拓展自费项目&lt;/p&gt;\n\n&lt;hr /&gt;\n&lt;p&gt;住院津贴保额/座&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;50元/天&nbsp;&lt;/p&gt;\n\n&lt;hr /&gt;\n&lt;p&gt;重症住院津贴/座&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;-&lt;/p&gt;\n\n&lt;hr /&gt;\n&lt;p&gt;陪伴护理津贴/座&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;-&lt;/p&gt;\n\n&lt;hr /&gt;\n&lt;p&gt;骨折内固定术/座&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;1000元&lt;/p&gt;\n\n&lt;hr /&gt;\n&lt;p&gt;紧急医疗转运/车&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;2万&lt;/p&gt;\n\n&lt;hr /&gt;\n&lt;p&gt;扩展临停期间责任&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;扩展&lt;/p&gt;\n\n&lt;hr /&gt;\n&lt;p&gt;五座保费（元/年）&nbsp; &nbsp; &nbsp;&nbsp;200元&lt;/p&gt;', '&lt;p&gt;购买须知：&lt;/p&gt;\n\n&lt;p&gt;1、客户付款后，请及时联系客服，根据客服引导领取《保险投保信息单》：&lt;/p&gt;\n\n&lt;p&gt;客服电话：400-8123511（工作日09:00&mdash;17:30）&lt;/p&gt;\n\n&lt;p&gt;2、按照表格要求如实填写《保险投保信息单》并提交给客服；&lt;/p&gt;\n\n&lt;p&gt;3、客服在收到表格后，7个工作日内寄出保险合同；&lt;/p&gt;\n\n&lt;p&gt;4、如购买【24个月加油充值套餐】，且每月不低于300元，可免费获得本产品；&lt;/p&gt;\n\n&lt;p&gt;&nbsp;&lt;/p&gt;\n\n&lt;p&gt;投保须知&lt;/p&gt;\n\n&lt;ol&gt;\n	&lt;li&gt;承保范围：5座及5座以下的非营运私家车，不承包摩托车、电瓶车、特种车、货车。&lt;/li&gt;\n	&lt;li&gt;本保险投保人须为车主，车辆实际使用人也可以作为投保人，每辆车仅限购买一份，多购无效。&lt;/li&gt;\n	&lt;li&gt;本保险中的被保险人无年龄限制。&lt;/li&gt;\n	&lt;li&gt;本保险采用不记名承保，被保险人为驾驶或乘坐该投保单中载明的机动车辆上的人员，受益人均为法定受益人。&lt;/li&gt;\n	&lt;li&gt;在保险期间内，被保险人因保单上列明的交通工具运行时需要临时停靠或检修、维护离开原来的交通工具至重新乘坐过程中遭受主险约定的意外伤害事故，保险人根据主险合同约定在保险金额范围内承担给付保险金责任。 临时停靠或检修、维护指保单上列明的交通工具进行故障清理、检修、维护或其他经保险人同意并在保险单载明的情形；&lt;/li&gt;\n	&lt;li&gt;在保险期间内，保险金申请人提出意外伤害医疗费用索赔时，如果已经从社会医疗保险或其他商业保险或其他任何途径获得补偿或赔偿，保险人将对剩余部分在保险责任范围内赔偿，如果没有从任何途径获得补偿或赔偿，保险人将按80%的比例在保险责任范围内赔偿。&lt;/li&gt;\n	&lt;li&gt;本保险中的被保险人驾驶或乘坐的车辆为非营运的客车，若被保险人驾驶或乘坐的车辆从事营业性运输活动期间发生意外伤害事故的，保险人不承担保险责任。&lt;/li&gt;\n	&lt;li&gt;被保险人在北京平谷区所有医院的就医均不属于本附加险保险合同认可，建议被保险人去往其他区域保险人认可医院就医；&lt;/li&gt;\n	&lt;li&gt;本产品由利宝保险有限公司承保，利宝保险有限公司在重庆、北京、浙江、广东、山东、四川、宁波、石家庄、天津设有分支机构，本产品的销售区域为全国，港澳台地区除外。&lt;/li&gt;\n	&lt;li&gt;利宝保险有限公司偿付能力充足率达到监管要求，详情可在利宝保险有限公司官方网站的&ldquo;公开信息披露&rdquo;处查阅。&lt;/li&gt;\n&lt;/ol&gt;', '0', null, null, '0', '1.00', null, '', 'http://47.99.115.136:8082/hykweb/f/app/download/image?filePath=/upload/20190313095900.png');
