INSERT INTO `hyk_news` VALUES ('93d3d774ea154427bd2d5b3a883b4d55', '【油价动态】2019年油价准备五连涨！', '&lt;p&gt;撰文|庄立人&lt;/p&gt;\n\n&lt;p&gt;据三湘风纪网3月18日消息，湖南隆回县原住房和城乡建设局党委书记、局长廖友学接受纪律审查和监察调查。&lt;/p&gt;\n\n&lt;p&gt;&lt;img src=&quot;http://pics2.baidu.com/feed/314e251f95cad1c85f71d77464d7ef0dcb3d518c.jpeg?token=8849680a000427648feda8853c41ccc9&amp;s=AC30459546320B825205ACDE03007012&quot; /&gt;&lt;/p&gt;\n\n&lt;p&gt;就在前一天晚上，官方还公布了隆回两名县委常委落马的消息：隆回县政协党组书记、主席黄和健涉嫌严重违纪违法，隆回县委常委、宣传部长刘科棉涉嫌严重违纪违法，正接受邵阳市纪委监委纪律审查和监察调查。&lt;/p&gt;\n\n&lt;p&gt;&lt;img src=&quot;http://pics3.baidu.com/feed/7e3e6709c93d70cf73aa4b65e3355904bba12b77.jpeg?token=b007a2a097b659672668ba21077264b8&amp;s=DA9318C660700B9EFEB890B703000015&quot; /&gt;&lt;/p&gt;\n\n&lt;p&gt;值得注意的是，三人都是湖南隆回当地人，都是60后。黄和健1962年6月出生，刘科棉1966年3月出生，廖友学1967年12月出生。&lt;/p&gt;\n\n&lt;p&gt;&lt;img src=&quot;http://pics1.baidu.com/feed/11385343fbf2b21187ba1e9cd069ed3c0ed78ebd.jpeg?token=f59e6d00c7fde6baaaa2461181a9f3c8&amp;s=A726F0040C1343CE72042087030080E2&quot; /&gt;&lt;/p&gt;\n\n&lt;p&gt;遗憾的是，都没有站好最后一班岗。&lt;/p&gt;\n\n&lt;p&gt;仕途起步于基层&lt;/p&gt;\n\n&lt;p&gt;三人仕途都起步于基层，而且黄和健与刘科棉还有交集。黄和健的基层履历，1998年始于六都寨镇，他是镇党委书记，直至2001年4月任隆回县委常委、政法委书记。刘科棉2000年任六都寨镇党委副书记、镇长，与黄和健搭班子。2001年4月，黄和健调任后，他接任镇党委书记一职。&lt;/p&gt;\n\n&lt;p&gt;不过，两人的交集远未结束。&lt;/p&gt;\n\n&lt;p&gt;黄和健在2004年短暂到邵阳市委任职统战部副部长，时间只有4个月，之后又回到隆回任副县级干部，3年后进入县委常委，再过一年升任政法委书记。2011年，黄和健成为正县级干部，2012年任隆回县政协党组书记、主席。他从工作伊始到正县级干部，花了27年时间。&lt;/p&gt;\n\n&lt;p&gt;刘科棉2004年调到隆回县政府工作后，一直担任当地工业园管委会办公室主任一职。2007年成为副县级干部，此时距离他参加工作已经过去22年。2014年他进入县委常委，任宣传部长，直至落马。&lt;/p&gt;\n\n&lt;p&gt;2018年3月17日，黄和健与刘科棉，这对曾经的上下级、老同事，在同一天被宣布接受纪律审查和监察调查。&lt;/p&gt;\n\n&lt;p&gt;5天前的3月12日，刘科棉还为隆回县委网络安全和信息化委员会办公室、县卫生健康局、县文化旅游广电体育局揭牌。&lt;/p&gt;\n\n&lt;p&gt;巡视引发的风暴&lt;/p&gt;\n\n&lt;p&gt;其实，两天三人落马，这场风暴肇始于去年。&lt;/p&gt;\n\n&lt;p&gt;2018年3月15日到5月30日，湖南省委第三巡视组对隆回县进行了巡视，7月份通报当地发现的问题，其中包括县委领导作用发挥不充分，三大攻坚战特别是脱贫攻坚工作推进不力。当时巡视组就收到一些涉及领导干部的问题反映。&lt;/p&gt;\n\n&lt;p&gt;去年10月份，隆回县委通报巡视整改进展情况。当地成立县委书记任组长、县长任第一副组长的巡视整改工作领导小组。整改时县纪委监委、县委组织部、县委宣传部及其他县直相关部门针对存在的区域性、多发性问题开展了多个专项治理。&lt;/p&gt;\n\n&lt;p&gt;通报还提到&ldquo;关于事关全县民生的重大决策部署调研不充分、决策不科学的问题&rdquo;，县四大班子成员完成调研报告49篇。&lt;/p&gt;\n\n&lt;p&gt;显然，黄和健作为四大班子之一的领导、刘科棉身为宣传部部长，都曾参与到巡视整改当中。没想到，短短几个月的时间，他们的马脚就再也遮不住了。&lt;/p&gt;\n\n&lt;p&gt;其中，巡视指出的廉政风险方面，则直陈隆回工程建设领域腐败问题。因此整改是严查未批先建、违规审批&hellip;&hellip;领导干部利用职权插手干预工程建设谋取私利等一批违纪违法案件。2019年3月18日，靴子落下，隆回县原住房和城乡建设局党委书记、局长廖友学落马。&lt;/p&gt;', 'http://47.99.115.136:8082/hykweb/f/app/download/image?filePath=/upload/20190326145656.jpg', '', '1', null, '2019-03-19 15:52:34', null, null, null, '0');
